def calculate_success_probability(N, T, L, B, Lose, Back):
    Lose_arr = [False for i in range(N + 1)]
    Back_arr = [False for i in range(N + 1)]
    for i in Lose:
        Lose_arr[i] = True
    for j in Back:
        Back_arr[j] = True
    dp = [[0.0 for j in range(N + 1)] for i in range(T + 2)]
    dp[0][0] = 2.0
    for t in range(T):
        for n in range(N):
            for k in range(1, 7):
                tmp = n + k
                if n + k > N:
                    tmp = N - (n + k - N)
                if Lose_arr[tmp]:
                    dp[t + 2][tmp] += dp[t][n] / 6
                elif Back_arr[tmp]:
                    dp[t + 1][0] += dp[t][n] / 6
                else:
                    dp[t + 1][tmp] += dp[t][n] / 6
    ans = 0.0
    for i in range(T + 2):
        ans += dp[i][N]
    return round(ans, 6)

